import React from "react";
import logo from "./logo.svg";
import "./App.css";
import Card from "./component/Card";

class App extends React.Component {
  constructor() {
    super();
    this.state = {
      loading: false,
      character: {}
    };
  }

  componentDidMount() {
    this.setState({ loading: true });
    fetch(
      "https://v2-api.sheety.co/69072a59b5982e9dd27aaa5bf290e8c6/dazad/api1"
    )
      .then(response => response.json())
      .then(data => {
        this.setState({
          loading: false,
          character: data
        });
      });
  }

  render() {
    const text = this.state.loading ? "loading..." : this.state.character.name;
    return (
      <div>
        <p>{text}</p>
      </div>
    );
  }
}

console.log(App);

export default App;
